set charset utf8;
CREATE TABLE `csm_guestbook` (
  `ID` varchar(32) NOT NULL COMMENT '主键',
  `USERCODE` varchar(10) DEFAULT NULL COMMENT '会员编号-@CSM_MEMBER',
  `LINKNAME` varchar(50) DEFAULT NULL COMMENT '联系人',
  `EMAIL` varchar(50) DEFAULT NULL COMMENT '联系人油箱',
  `MOBILE` varchar(50) DEFAULT NULL COMMENT '联系人电话',
  `TITLE` varchar(200) DEFAULT NULL COMMENT '留言标题',
  `CONTENT` varchar(1000) DEFAULT NULL COMMENT '留言内容',
  `ADDTIME` varchar(19) DEFAULT NULL COMMENT '留言时间-@yyyy-MM-dd HH:mm:ss',
  `ADDIP` varchar(50) DEFAULT NULL COMMENT '留言IP',
  `REPCONTENT` varchar(200) DEFAULT NULL COMMENT '回复内容',
  `REPTIME` varchar(19) DEFAULT NULL COMMENT '回复时间-@yyyy-MM-dd HH:mm:ss',
  `TYPE` varchar(50) DEFAULT NULL COMMENT '类型-@LIST:GUESTBOOK_TYPE',
  `KEYVALUE` varchar(50) DEFAULT NULL COMMENT '主键值',
  `ISREPLAY` varchar(1) DEFAULT NULL,
  `REIP` varchar(50) DEFAULT NULL,
  `REUSERCODE` varchar(10) DEFAULT NULL,
  `SHOPUSERCODE` varchar(10) DEFAULT NULL,
  `ORGID` varchar(10) DEFAULT NULL COMMENT '接收单位',
  `CARDID` varchar(18) DEFAULT NULL COMMENT 'PERSON.身份证号',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员.咨询留言';
CREATE TABLE `csm_member` (
  `USERCODE` varchar(10) NOT NULL COMMENT '会员编号(不能重复)-@10位数字组成，账号范围(10000001-99999999)',
  `USERACCOUNT` varchar(255) DEFAULT NULL,
  `MOBILE` varchar(11) DEFAULT NULL COMMENT '业务联系手机(不能重复)',
  `EMAIL` varchar(100) DEFAULT NULL COMMENT '业务联系邮箱(不能重复)',
  `NICKNAME` varchar(100) DEFAULT NULL COMMENT '昵称',
  `USERTYPE` int(11) DEFAULT NULL COMMENT '会员类型-@LIST:1会员从前台登录、9管理员从后台登录',
  `USERLEVEL` varchar(1) DEFAULT NULL COMMENT '会员级别-@LIST:1普通会员、2体验会员、3专业会员、  4金牌会员、5钻石会员',
  `LINKAREA` varchar(50) DEFAULT NULL COMMENT '联系地址-@省-市-县',
  `LINKADDRESS` varchar(100) DEFAULT NULL COMMENT '联系地址(详细地址)',
  `LINKPOST` varchar(15) DEFAULT NULL COMMENT '邮编',
  `PWD` varchar(50) DEFAULT NULL COMMENT '密码',
  `PAYPWD` varchar(100) DEFAULT NULL COMMENT '支付密码',
  `LINKTEL` varchar(20) DEFAULT NULL COMMENT '固定电话--@区号-电话号码-分机号',
  `MASK` varchar(10) DEFAULT NULL COMMENT '验证码 用于账号注册邮件确认',
  `MASKAVAILDATE` varchar(19) DEFAULT NULL COMMENT '验证码有效期-@yyyy-MM-dd HH:mm:ss',
  `REGTIME` varchar(19) DEFAULT NULL COMMENT '注册时间-@yyyy-MM-dd HH:mm:ss',
  `LOGINCOUNT` int(11) DEFAULT NULL COMMENT '登陆次数',
  `PREVLOGINIP` varchar(20) DEFAULT NULL COMMENT '上次登陆IP',
  `PREVLOGINTIME` varchar(19) DEFAULT NULL COMMENT '上次登陆时间-@yyyy-MM-dd HH:mm:ss',
  `LASTLOGINIP` varchar(20) DEFAULT NULL COMMENT '最后一次登陆IP',
  `LASTLOGINTIME` varchar(19) DEFAULT NULL COMMENT '最后一次登陆时间-@yyyy-MM-dd HH:mm:ss',
  `ENDTIME` varchar(10) DEFAULT NULL COMMENT '会员有效期如果为空，则永久有效-@yyyy-MM-dd',
  `CSMGROUPID` int(11) DEFAULT NULL COMMENT '会员组ID-@CSM_GROUP',
  `FIMGROUPID` int(11) DEFAULT NULL COMMENT '管理员组ID-@FIM_MENUITEM',
  `QQ` varchar(100) DEFAULT NULL COMMENT 'QQ',
  `MSN` varchar(100) DEFAULT NULL COMMENT 'MSN',
  `WW` varchar(100) DEFAULT NULL COMMENT '阿里旺旺',
  `EMAIL_IS_VERTIFY` varchar(1) DEFAULT NULL COMMENT '邮箱是否通过验证-@LIST:SF(0否1是)',
  `MOBILE_IS_VERTIFY` varchar(1) DEFAULT NULL COMMENT '手机号码是否通过验证-@LIST:SF(0否1是)',
  `PIC` varchar(200) DEFAULT NULL COMMENT '会员头像-@fim_upload_col:CSM_MEMBER_PIC',
  `SESSIONID` varchar(255) DEFAULT NULL,
  `WXOPENID` varchar(200) DEFAULT NULL,
  `USERNAME` varchar(100) DEFAULT NULL COMMENT 'PERSON.姓名',
  `SEX` varchar(2) DEFAULT NULL COMMENT 'PERSON.性别-@LIST:SEX(0女/1男)',
  `BIRTHDAY` varchar(10) DEFAULT NULL COMMENT 'PERSON.出生-@yyyy-MM-dd',
  `CARDID` varchar(18) DEFAULT NULL COMMENT 'PERSON.身份证号',
  `ADDRESS` varchar(255) DEFAULT NULL COMMENT 'PERSON.住址',
  `NATION` varchar(50) DEFAULT NULL COMMENT '民族',
  `ENDDATE` varchar(10) DEFAULT NULL COMMENT 'PERSON.有效期限-@yyyy-MM-dd',
  `AUDITSTATE` varchar(1) DEFAULT NULL COMMENT 'AUDIT.认证状态-@LIST:AUDITSTATE(9未提交/0待审核1已认证/2驳回)',
  `AUDITUSERCODE` varchar(10) DEFAULT NULL COMMENT 'AUDIT.审核人员.会员编号-@CSM_MEMBER',
  `AUDITTIME` varchar(19) DEFAULT NULL COMMENT 'AUDIT.审核时间-@yyyy-MM-dd HH:mm:ss',
  `ORGID` varchar(500) DEFAULT NULL COMMENT '管理员所在机构',
  `EDUCATION` varchar(200) DEFAULT NULL COMMENT '学历',
  `WORKADDRESS` varchar(200) DEFAULT NULL COMMENT '工作地址',
  `WORKUNIT` varchar(200) DEFAULT NULL COMMENT '工作单位',
  `WORKUNITJOB` varchar(200) DEFAULT NULL COMMENT '单位职务',
  `ORIGINADDRESS` varchar(200) DEFAULT NULL COMMENT '籍贯',
  `POLITICALSTATUS` varchar(200) DEFAULT NULL COMMENT '政治面貌',
  `JOINPARTYTIME` varchar(10) DEFAULT NULL COMMENT '入党时间',
  `LIVEADDRESS` varchar(200) DEFAULT NULL COMMENT '居住地址',
  `PERMANENTADDRESS` varchar(200) DEFAULT NULL COMMENT '户籍地址',
  `ISPARTWORK` varchar(1) DEFAULT NULL COMMENT '是否党务工作者',
  `ISVOLUNTEER` varchar(1) DEFAULT NULL COMMENT '是否志愿者',
  `ISHANDPARTY` varchar(1) DEFAULT NULL COMMENT '是否困难党员',
  `INTERALUPTIME` varchar(19) DEFAULT NULL COMMENT '积分更新时间',
  `INTERALORDER` int(11) DEFAULT NULL,
  `INTERAL` int(11) DEFAULT NULL COMMENT '会员积分',
  `ISORGMANAGER` varchar(1) DEFAULT NULL COMMENT '是否组织管理员',
  PRIMARY KEY (`USERCODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `csm_syslog` (
  `ID` varchar(32) NOT NULL COMMENT '主键--@UUID',
  `USERCODE` varchar(10) DEFAULT NULL COMMENT '会员编号-@CSM_MEMBER',
  `USERACCOUNT` varchar(50) DEFAULT NULL COMMENT '会员账号@CSM_MEMBER:USERACCOUNT',
  `NICKNAME` varchar(50) DEFAULT NULL COMMENT '会员昵称@CSM_MEMBER:NICKNAME',
  `REMARK` varchar(500) DEFAULT NULL COMMENT '操作内容',
  `OPTTIME` varchar(19) DEFAULT NULL COMMENT '操作时间-@yyyy-MM-dd HH:mm:ss',
  `OPTIP` varchar(20) DEFAULT NULL COMMENT '操作IP',
  `REALIP` varchar(20) DEFAULT NULL COMMENT '操作真实IP',
  `OPERURL` varchar(200) DEFAULT NULL COMMENT '操作URL',
  `TYPE` varchar(2) DEFAULT NULL COMMENT '类型-@LIST:LOGTYPE(1登陆日志/2修改密码日志/3操作日志)',
  `OPTDATE` varchar(10) DEFAULT NULL COMMENT '操作日期-@yyyy-MM-dd',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='300010会员.操作日志表';
CREATE TABLE `fim_codecatalog` (
  `CODENO` varchar(50) NOT NULL COMMENT '类别',
  `CODENAME` varchar(50) DEFAULT NULL COMMENT '类别名称',
  `CODEDESCRIBE` varchar(50) DEFAULT NULL COMMENT '类别描述',
  `ITEMNOLENGTH` int(11) DEFAULT NULL COMMENT '编码长度',
  `KIND` varchar(50) DEFAULT NULL COMMENT '种类',
  PRIMARY KEY (`CODENO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_codelibrary` (
  `ID` varchar(32) NOT NULL COMMENT '主键ID',
  `CODENO` varchar(50) DEFAULT NULL COMMENT '类别-@FIM_CODECATALOG',
  `ITEMNO` varchar(50) DEFAULT NULL COMMENT '代码',
  `ITEMNAME` varchar(50) DEFAULT NULL COMMENT '名称',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序',
  `REMARK` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_group` (
  `ID` varchar(32) NOT NULL COMMENT '编号',
  `DESCRIPTION` varchar(200) DEFAULT NULL COMMENT '描述',
  `TITLE` varchar(50) DEFAULT NULL COMMENT '用户组名称',
  `VALID` int(11) DEFAULT NULL COMMENT '有效标志-@LIST:SF(0否1是)',
  `GROUPLEVEL` int(11) DEFAULT NULL COMMENT '级别-1为开发用户组，具有所有权限',
  `NEWITEMSLIST` varchar(20000) DEFAULT NULL COMMENT '新闻权限列表',
  `ORGID` varchar(50) DEFAULT NULL COMMENT '机构ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_groupmenu` (
  `ID` varchar(32) NOT NULL COMMENT '主键-@GROUPID_MENUID_QXBZ',
  `GROUPID` varchar(50) DEFAULT NULL COMMENT '用户组-@FIM_GROUP',
  `MENUID` varchar(50) DEFAULT NULL COMMENT '菜单ID-@FIM_MENUITEM',
  `QXBZ` varchar(500) DEFAULT NULL COMMENT '权限标志',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_menuitem` (
  `ID` varchar(3) NOT NULL COMMENT '编号',
  `PARENTID` varchar(3) DEFAULT NULL COMMENT '父编号',
  `POSITION` varchar(255) DEFAULT NULL COMMENT '位置',
  `TITLE` varchar(50) DEFAULT NULL COMMENT '菜单名称',
  `SHORTTITLE` varchar(50) DEFAULT NULL COMMENT '简称',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序',
  `LINKURL` varchar(200) DEFAULT NULL COMMENT 'url地址',
  `TARGET` varchar(255) DEFAULT NULL,
  `QXBZ` varchar(1000) DEFAULT NULL COMMENT '权限标志',
  `SMALLICON` varchar(255) DEFAULT NULL COMMENT '小图标',
  `BIGICON` varchar(255) DEFAULT NULL COMMENT '大图标',
  `VALID` int(11) DEFAULT NULL COMMENT '有效标志-@LIST:SF(0否1是)',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_org` (
  `ID` varchar(255) NOT NULL COMMENT '组织机构编码',
  `PARENTID` varchar(255) DEFAULT NULL COMMENT '组织机构父编码',
  `POSITION` varchar(255) DEFAULT NULL COMMENT '位置每三位决定一级',
  `TITLE` varchar(255) DEFAULT NULL COMMENT '名称',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序索引',
  `TYPE` varchar(50) DEFAULT NULL COMMENT '类型',
  `DESCRIPTION` varchar(500) DEFAULT NULL COMMENT '描述',
  `LINKMAN` varchar(100) DEFAULT NULL COMMENT '联系人',
  `LINKMOBILE` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `ADMINS` varchar(500) DEFAULT NULL COMMENT '管理员',
  `PIC` varchar(200) DEFAULT NULL COMMENT '组织图片',
  `ADDRESS` varchar(200) DEFAULT NULL COMMENT '组织地址',
  `ORGKIND` varchar(255) DEFAULT NULL COMMENT '组织类型：国有集体企业、机关单位、“两新”组织、村改制公司、事业单位、社区',
  `INTERAL` int(11) DEFAULT NULL COMMENT '组织总积分=INTERALORG+会员平均分',
  `INTERALORG` int(11) DEFAULT NULL COMMENT '组织获取积分',
  `INTERALAVG` int(11) DEFAULT NULL COMMENT '会员平均分',
  `INTERALUPTIME` varchar(19) DEFAULT NULL COMMENT '积分更新时间',
  `INTERALORDER` int(11) DEFAULT NULL,
  `MAPX` varchar(20) DEFAULT NULL COMMENT '百度地图维度',
  `MAPY` varchar(20) DEFAULT NULL COMMENT '百度地图经度',
  `MEMBERNUM` int(11) DEFAULT NULL COMMENT '党员数量',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `fim_para` (
  `PARACODE` varchar(255) NOT NULL COMMENT '参数代码',
  `PARACONTENT` varchar(255) DEFAULT NULL COMMENT '参数内容',
  `DESCRIPTION` varchar(2000) DEFAULT NULL COMMENT '描述',
  `PARACLASS` varchar(255) DEFAULT NULL COMMENT '类别',
  PRIMARY KEY (`PARACODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `fim_upload_col` (
  `UPLOADCOLKEY` varchar(100) NOT NULL COMMENT '主键-@TABLENAME+UPLOADCOL',
  `TABLENAME` varchar(100) DEFAULT NULL COMMENT '上传表',
  `UPLOADCOL` varchar(50) DEFAULT NULL COMMENT '上传表字段',
  `ALLOWFILETYPE` varchar(500) DEFAULT NULL COMMENT '允许文件类型，用逗号分隔',
  `VIRTUALSAVEPATH` varchar(500) DEFAULT NULL COMMENT '虚拟路径',
  `DESCRIPTION` varchar(500) DEFAULT NULL COMMENT '说明',
  `README` varchar(500) DEFAULT NULL COMMENT '备注',
  `FILEMAXLENTH` int(11) DEFAULT NULL COMMENT '上传文件的最大值字节(以KB为单位)3*1024*KB',
  `FILENUM` int(11) DEFAULT NULL COMMENT '上传文件的最大数量,默认为1，只能上传一个文件',
  PRIMARY KEY (`UPLOADCOLKEY`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `ims_jobs` (
  `ID` varchar(32) NOT NULL,
  `USERNAME` varchar(100) DEFAULT NULL COMMENT '姓名',
  `SEX` varchar(2) DEFAULT NULL COMMENT '性别',
  `BIRTHDAY` varchar(10) DEFAULT NULL COMMENT 'PERSON.出生-@yyyy-MM-dd',
  `NATION` varchar(50) DEFAULT NULL COMMENT '民族',
  `LINKAREA` varchar(50) DEFAULT NULL COMMENT '联系地址-@省-市-县',
  `LINKADDRESS` varchar(100) DEFAULT NULL COMMENT '联系地址(详细地址)',
  `SCHOOL_TITLE` varchar(100) DEFAULT NULL COMMENT '学校',
  `SCHOOL_ZY` varchar(100) DEFAULT NULL COMMENT '专业',
  `EDUCATION` varchar(200) DEFAULT NULL COMMENT '学历',
  `MOBILE` varchar(11) DEFAULT NULL COMMENT '业务联系手机(不能重复)',
  `SELFINTRO` varchar(500) DEFAULT NULL COMMENT '个人介绍',
  `SELFINTRO2` varchar(500) DEFAULT NULL COMMENT '个人特长',
  `SELFINTRO3` varchar(500) DEFAULT NULL,
  `ADDTIME` varchar(19) DEFAULT NULL COMMENT '增加时间-@YYYY-MM-DD',
  `STATE` varchar(1) DEFAULT NULL COMMENT '状态(0待联系，1已联系，无效)',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_menu` (
  `MENUID` int(5) NOT NULL COMMENT '主键从10000开始',
  `PARENT` int(11) DEFAULT NULL COMMENT '父菜单ID',
  `POSITION` varchar(50) DEFAULT NULL COMMENT '位置(每三位决定一级)',
  `KIND` varchar(50) DEFAULT NULL COMMENT '-@菜单种类:TOP:顶部,BOTTOM:底部',
  `TITLE` varchar(50) DEFAULT NULL COMMENT '菜单名称',
  `ENTITLE` varchar(50) DEFAULT NULL COMMENT '英文栏目，不知道怎么填写，用汉语拼音代替',
  `PIC` varchar(200) DEFAULT NULL COMMENT '图片地址@fim_upload_col:',
  `LINKURL` varchar(200) DEFAULT NULL COMMENT '链接地址',
  `TARGET` varchar(20) DEFAULT NULL COMMENT '_@LIST:_SELF,_BLANK',
  `INTRO` varchar(200) DEFAULT NULL COMMENT '简介',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序索引',
  `MODELTYPE` varchar(50) DEFAULT NULL COMMENT '-@LIST:NEWSITEM:新闻栏目，NEWS:新闻,SUPPLYCLASS:商品分类,SUPPLY:商品,URL:链接地址',
  `KEYVALUE` varchar(50) DEFAULT NULL COMMENT '对应栏目',
  `META_KEYWORDS` varchar(200) DEFAULT NULL COMMENT '关键字',
  `META_DESCRIPTION` varchar(200) DEFAULT NULL COMMENT '关键字描述',
  `BGPICJSON` varchar(500) DEFAULT NULL COMMENT '页面背景图片',
  `CHANGEPICJSON` varchar(500) DEFAULT NULL COMMENT '导航下轮换广告',
  `HTMLURL` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`MENUID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_news` (
  `ID` int(32) NOT NULL,
  `ITEMSCODE` varchar(50) DEFAULT NULL COMMENT '新闻栏目编号-@IMS_NEWSITEMS',
  `TITLE` varchar(200) DEFAULT NULL COMMENT '标题',
  `KEYTITLE` varchar(255) DEFAULT NULL COMMENT '关键字',
  `AUTHOR` varchar(50) DEFAULT NULL COMMENT '作者',
  `EMAIL` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `COPYFROM` varchar(200) DEFAULT NULL COMMENT '来源',
  `FROMURL` varchar(200) DEFAULT NULL COMMENT '来源地址',
  `HITS` int(11) DEFAULT NULL COMMENT '点击率',
  `ISDEL` int(11) DEFAULT NULL COMMENT '是否删除-LIST:SF(0未删除/1已删除)',
  `TITLECOLOR` varchar(50) DEFAULT NULL COMMENT '标题颜色',
  `TITLEFONT` varchar(50) DEFAULT NULL COMMENT '标题字体',
  `MODIFYUSERCODE` varchar(10) DEFAULT NULL COMMENT '修改人.会员编号-@CSM_MEMBER',
  `ADDUSERCODE` varchar(10) DEFAULT NULL COMMENT '增加人.会员编号-@CSM_MEMBER',
  `AUDITUSERCODE` varchar(10) DEFAULT NULL COMMENT '审批人.会员编号--@CSM_MEMBER',
  `ADDTIME` varchar(19) DEFAULT NULL COMMENT '增加时间--@yyyy-MM-dd HH:mm:ss',
  `UPDATETIME` varchar(19) DEFAULT NULL COMMENT '更新时间--@yyyy-MM-dd HH:mm:ss',
  `AUXTITLE` varchar(200) DEFAULT NULL COMMENT '文章副标题',
  `SUMMARY` varchar(300) DEFAULT NULL COMMENT '摘要',
  `ADDIP` varchar(20) DEFAULT NULL COMMENT '增加人IP',
  `ISHOT` int(11) DEFAULT NULL COMMENT '是否热点0否1是-@LIST:SF',
  `ISTOP` int(11) DEFAULT NULL COMMENT '置顶0否1是-@LIST:SF',
  `ISTJ` int(11) DEFAULT NULL COMMENT '推荐0否1是-@LIST:SF',
  `ISROLL` int(11) DEFAULT NULL COMMENT '是否滚动0:否 1:是-@LIST:SF',
  `ISINCLUDEPIC` int(11) DEFAULT NULL COMMENT '是否包含图片 0:否 1:是-@LIST:SF',
  `AUDITSTATE` varchar(1) DEFAULT NULL COMMENT '审核通过 0:未通过 1:通过1-@LIST:AUDITSTATE( 0未通过/1通过 )',
  `CONTENT` varchar(200) DEFAULT NULL COMMENT '新闻内容路径',
  `PIC1` varchar(200) DEFAULT NULL COMMENT '新闻默认图片-@fim_upload_col:IMS_NEWS_1',
  `PIC2` varchar(1000) DEFAULT NULL COMMENT '上传图片列表-@fim_upload_col:IMS_NEWS_2',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序id',
  `VIDEO` varchar(200) DEFAULT NULL COMMENT '视频地址[视频模型]',
  `DOWNFILE` varchar(200) DEFAULT NULL COMMENT '文件下载地址[软件下载模型]',
  `LINKURL` varchar(200) DEFAULT NULL COMMENT '外部链接[友情链接模型]',
  `ORIGINAL_PRICE` int(11) DEFAULT NULL COMMENT '原始价[产品模型]',
  `PRICE` int(11) DEFAULT NULL COMMENT '当前价格[产品模型]',
  `UNIT` varchar(50) DEFAULT NULL COMMENT '计量单位[产品模型]',
  `MINIMUM_NUM` int(11) DEFAULT NULL COMMENT '最小起订量[产品模型]',
  `PIC3` varchar(200) DEFAULT NULL,
  `PIC4` varchar(200) DEFAULT NULL,
  `PIC5` varchar(200) DEFAULT NULL,
  `PIC6` varchar(200) DEFAULT NULL,
  `COLORJSON` varchar(2000) DEFAULT NULL,
  `SIZEJSON` varchar(2000) DEFAULT NULL,
  `HTMLURL` varchar(200) DEFAULT NULL,
  `ORGID` varchar(3) DEFAULT NULL,
  `ENDTIME` varchar(19) DEFAULT NULL,
  `ATTR_COL1` varchar(500) DEFAULT NULL,
  `ATTR_COL2` varchar(500) DEFAULT NULL,
  `ATTR_COL3` varchar(500) DEFAULT NULL,
  `ATTR_COL4` varchar(500) DEFAULT NULL,
  `ATTR_COL5` varchar(500) DEFAULT NULL,
  `ATTR_COL6` varchar(500) DEFAULT NULL,
  `ATTR_COL7` varchar(500) DEFAULT NULL,
  `ATTR_COL8` varchar(500) DEFAULT NULL,
  `ATTR_COL9` varchar(500) DEFAULT NULL,
  `ATTR_COL10` varchar(500) DEFAULT NULL,
  `ATTR_COL11` varchar(500) DEFAULT NULL,
  `ATTR_COL12` varchar(500) DEFAULT NULL,
  `ATTR_COL13` varchar(500) DEFAULT NULL,
  `ATTR_COL14` varchar(500) DEFAULT NULL,
  `ATTR_COL15` varchar(500) DEFAULT NULL,
  `ATTR_COL16` varchar(500) DEFAULT NULL,
  `ATTR_COL17` varchar(500) DEFAULT NULL,
  `ATTR_COL18` varchar(500) DEFAULT NULL,
  `ATTR_COL19` varchar(500) DEFAULT NULL,
  `ATTR_COL20` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `ims_news_attr` (
  `ID` varchar(32) NOT NULL,
  `NEWSID` varchar(50) DEFAULT NULL,
  `ATTRTITLE` varchar(50) DEFAULT NULL,
  `ATTRCONTENT` varchar(500) DEFAULT NULL,
  `ORDERINDEX` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_news_attrtemp` (
  `ID` varchar(32) NOT NULL,
  `ATTRTITLE` varchar(50) DEFAULT NULL COMMENT '属性名',
  `ITEMSCODE` varchar(4) DEFAULT NULL COMMENT '栏目分类',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序索引',
  `TYPE` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_news_pingjia` (
  `ID` varchar(32) NOT NULL COMMENT '主键--@UUID',
  `PINGJIALEVEL` int(11) DEFAULT NULL COMMENT '级别(评价分数)',
  `USERCODE` varchar(10) DEFAULT NULL COMMENT '评价会员-@CMS_MEMBER',
  `ADDTIME` varchar(19) DEFAULT NULL COMMENT '评价时间-@yyyy-MM-dd HH:mm:ss',
  `CONTENT` varchar(200) DEFAULT NULL COMMENT '评价内容',
  `NEWSID` varchar(28) DEFAULT NULL COMMENT '新闻主键-@IMS_NEWS',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `ims_newsclass` (
  `ID` varchar(255) NOT NULL,
  `ITEMSCODE` int(255) DEFAULT NULL,
  `NEWSID` int(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_newsitems` (
  `ITEMSCODE` int(11) NOT NULL COMMENT '栏目编号',
  `PARENT` int(11) DEFAULT NULL COMMENT '父栏目',
  `POSITION` varchar(30) DEFAULT NULL COMMENT '位置(每三位决定一级)',
  `TITLE` varchar(200) DEFAULT NULL COMMENT '栏目名称',
  `ENTITLE` varchar(200) DEFAULT NULL COMMENT '英文栏目，不知道怎么填写，用汉语拼音代替',
  `ISSHOW` int(11) DEFAULT NULL COMMENT '是否显示-@LIST:SF',
  `INTRO` varchar(200) DEFAULT NULL COMMENT '栏目介绍',
  `LINKURL` varchar(200) DEFAULT NULL COMMENT '栏目连接地址',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序id',
  `LINKPIC` varchar(200) DEFAULT NULL COMMENT '栏目显示图片(备用)//作为静态访问地址使用',
  `HOT` int(11) DEFAULT NULL COMMENT '是否热点栏目(备用)-@LIST:SF',
  `TJ` int(11) DEFAULT NULL COMMENT '是否为推荐栏目(备用)-@LIST:SF',
  `ADDIP` varchar(20) DEFAULT NULL COMMENT '添加人IP',
  `ITEMTYPE` int(11) DEFAULT NULL COMMENT '栏目类型-@LIST:ITEMTYPE(0新闻栏目/1非新闻栏目/2介绍类)',
  `ADDUSERCODE` varchar(10) DEFAULT NULL COMMENT '添加人.会员编号-@FIM_USER:USERCODE',
  `ADDTIME` varchar(20) DEFAULT NULL COMMENT '添加日期-@yyyy-MM-dd HH:mm:ss',
  `MODIFYUSERCODE` varchar(10) DEFAULT NULL COMMENT '修改人.会员编号-@FIM_USER:USERCODE',
  `MODIFYTIME` varchar(20) DEFAULT NULL COMMENT '修改日期-@yyyy-MM-dd HH:mm:ss',
  `META_TITLE` varchar(200) DEFAULT NULL,
  `META_KEYWORDS` varchar(200) DEFAULT NULL,
  `META_DESCRIPTION` varchar(200) DEFAULT NULL,
  `HTMLURL` varchar(200) DEFAULT NULL,
  `NEWSNUM` int(11) DEFAULT NULL COMMENT '新闻数量',
  `BGPICJSON` varchar(500) DEFAULT NULL COMMENT '页面背景图片',
  `CHANGEPICJSON` varchar(500) DEFAULT NULL COMMENT '导航下轮换广告',
  `MODELTYPE` varchar(50) DEFAULT NULL COMMENT '-@LIST:NEWSITEM:新闻栏目，NEWS:新闻,SUPPLYCLASS:商品分类,SUPPLY:商品,URL:链接地址',
  `KEYVALUE` varchar(50) DEFAULT NULL COMMENT '对应栏目',
  `PINPAI` int(11) DEFAULT NULL COMMENT '是否是品牌栏目，显示到页面的顶部-@LIST:SF',
  `COL_ISREQUIRE_PIC1` varchar(1) DEFAULT NULL COMMENT '新闻图片字段是否允许为空',
  `COL_ISREQUIRE_VIDEO` varchar(1) DEFAULT NULL COMMENT '新闻视频字段是否允许为空',
  `COL_ISREQUIRE_DOWNFILE` varchar(1) DEFAULT NULL COMMENT '新闻简介是否允许为空',
  `COL_ISREQUIRE_SUMMARY` varchar(1) DEFAULT NULL COMMENT '新闻下载字段是否允许为空',
  PRIMARY KEY (`ITEMSCODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `ims_pageplate` (
  `ID` int(11) NOT NULL COMMENT '首页板块ID',
  `TITLE` varchar(200) DEFAULT NULL,
  `CLASSCODE` varchar(50) DEFAULT NULL,
  `TYPE` int(11) DEFAULT NULL COMMENT '类型1新闻2广告',
  `CONTENT` varchar(2000) DEFAULT NULL COMMENT '板块内容json串',
  `DESCRIPTION` varchar(255) DEFAULT NULL COMMENT '描述',
  `WIDTH` int(11) DEFAULT NULL,
  `HEIGHT` int(11) DEFAULT NULL,
  `ITEMSCODE` int(11) DEFAULT NULL COMMENT '网站栏目',
  `ORDERINDEX` int(11) DEFAULT NULL,
  `CONTENTTXT` varchar(200) DEFAULT NULL COMMENT '文件内容',
  `MENUID` varchar(20) DEFAULT NULL,
  `STYLENAME` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='500006信息管理.页面板块';
CREATE TABLE `ims_pageplate_pics` (
  `ID` varchar(32) NOT NULL COMMENT '主键',
  `TITLE` varchar(100) DEFAULT NULL COMMENT '名称',
  `DESCRIPTION` varchar(300) DEFAULT NULL COMMENT '广告介绍',
  `LINKURL` varchar(200) DEFAULT NULL COMMENT '连接地址',
  `ADDTIME` varchar(19) DEFAULT NULL COMMENT '添加时间-@yyyy-MM-dd HH:mm:ss',
  `STATE` varchar(1) DEFAULT NULL COMMENT '状态-@LIST:STATE(0正常/1锁定)',
  `PLATEID` int(11) DEFAULT NULL COMMENT '广告位ID-@IMS_ADVPLACE',
  `PIC` varchar(200) DEFAULT NULL COMMENT '广告图片-@fim_upload_col:IMS_ADVERTISEMENT_1',
  `ORDERINDEX` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `ims_weblink` (
  `ID` varchar(32) NOT NULL,
  `TITLE` varchar(100) DEFAULT NULL COMMENT '标题',
  `LINKURL` varchar(400) DEFAULT NULL COMMENT '链接地址',
  `TYPE` varchar(100) DEFAULT NULL COMMENT '链接类型-@LIST:WEBLINKTYPE(0图片链接/1文字链接)',
  `DESCTION` varchar(255) DEFAULT NULL COMMENT '描述',
  `ISSHOW` int(11) DEFAULT NULL COMMENT '是否显示-@LIST:SF',
  `ORDERINDEX` int(11) DEFAULT NULL COMMENT '排序id',
