  `HITS` int(11) DEFAULT NULL COMMENT '点击次数',
  `PIC` varchar(200) DEFAULT NULL COMMENT '图片地址-@fim_upload_col:IMS_WEBLINK_1',
  PRIMARY KEY (`ID`)
