CREATE TABLE `wap_plate` (
  `PLATEID` int(32) NOT NULL COMMENT '主键',
  `TYPE` varchar(50) DEFAULT NULL COMMENT '类型',
  `TITLE` varchar(100) DEFAULT NULL COMMENT '名称',
